void echo(int indent, Object... args) {
  String prev = null;
  for (Object o : args) {
    String s = String.valueOf(o);
    if (!s.isEmpty() && !s.equals("\n") &&
        (prev == null || prev.endsWith("\n"))) {
      indent(indent);
    }
    prev = s;
    out.print(s);
    bytes += s.length();
  }
}
